import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div>
      <h1>Bockscar Device Tracker Home Page</h1>
      <p>Welcome to the Device Tracker App. This app is designed to track the status of iPad devices in a fleet.</p>
      <Link to='/devices'>View Devices</Link>
    </div>
  );
}

export default HomePage;
